def funkcja_u(t):
  '''Definicja funkcji u na przedzialach'''
  if t<0 or t >= 3.1:
    raise Exception("Wrong time!!")
  if t < 1.2:
    return (-t**2 + 0.5)*sin(30*pi*t)*log(t**2+1,2)
  if t < 2:
    return (1/t)*0.8*sin(24*pi*t)-0.1*t
  if t < 2.4:
    abs(sin(2*pi*t*2))**0.8
  if t < 3.1:
    return 0.23*sin(20*pi*t)*sin(12*pi*t)


