from functools import partial

def funkcja_b_k(t, k):
  '''definicja funkcji b_k dla k=1,2,3'''
  H = [2,20,40]
  return sum([(cos( 2*pi *h*t + sin(6*pi*t)))*((-1)**h)/(3*h**2) for h in range(1, H[k-1])])


