def DFT(x):
  '''Funkcja realizujaca Dyskretna Transformate Fouriera dla sygnalu wejsciowego: x. Funkcja oblicza dft tylko dla polowy sygnalu ze wzgledu na symetrie'''
  #dlugosc sygnalu
  N = len(x)
  #ze wzgledu na symetrie DFT
  if N % 2 == 0:
    dft = [sum([x[n] * exp(complex(0,-(2*pi*k*n)/N)) for n in range(N)]) for k in range(int(N/2))]
    #kopia pierwszej polowy ciagu
    dft.extend(reversed(dft))
  else:
    dft = [sum([x[n] * exp(complex(0,-(2*pi*k*n)/N)) for n in range(N)]) for k in range(int((N+1)/2))]
    #kopia pierwszej polowy ciagu
    dft.extend(reversed(dft[:-1]))
  return dft

